import React from 'react';

function AboutUs() {
  return (
    <div>
      <div className="container">
        <h3 className="pt-5 text-center">加入社群</h3>
        <div className="row text-center d-flex">
          <i className="fab fa-facebook-square p-2"></i>
          <i className="fab fa-instagram p-2"></i>
          <i className="fab fa-twitter p-2"></i>
          <i className="far fa-envelope p-2"></i>
          <i className="fab fa-youtube p-2"></i>
          <i className="fas fa-phone p-2"></i>
        </div>
      </div>
    </div>
  );
}

export default AboutUs;
